import React from "react";
import { Pie } from "react-chartjs-2";

const GenderChart = ({ data }) => {
    if (!data) {
        return <p>Loading gender chart...</p>;
    }
    const chartData = {
        labels: ["남성", "여성"],
        datasets: [
            {
                data: [data.m, data.f],
                backgroundColor: ["#36A2EB", "#FF6384"],
                hoverOffset: 4
            }
        ]
    };

    return (
        <div>
          <h3>성별 검색량</h3>
          <Pie data={chartData} />
        </div>
    );
};

export default GenderChart;
